  name: AspNetCacheProfileAttribute
  nameWithType: AspNetCacheProfileAttribute
  fullName: System.ServiceModel.Web.AspNetCacheProfileAttribute
  type: Class
  summary: When applied to a service operation, indicates the ASP.NET output cache profile in the configuration file that should be used by [!INCLUDE[indigo2](~/add/includes/indigo2-md.md)] to cache responses from the operation in the ASP .NET Output Cache.
  remarks: '[!INCLUDE[crabout](~/add/includes/crabout-md.md)] the kinds of setting you can make with the Output Cache Profile, see [ASP.NET Cache Settings](http://go.microsoft.com/fwlink/?LinkId=179061).'
  example:
  - "The following example shows how to apply the AspNetCacheProfileAttribute attribute to a service operation. In this case, the cache profile named “CacheFor60Seconds” will be used for the `GetCustomer` operation  \n  \n [!CODE [AspNetCacheIntegration#0](AspNetCacheIntegration#0)]  \n  \n The following configuration snippet shows how the “CacheFor60Seconds” cache profile is specified.  \n  \n```xml  \n<configuration>  \n    <system.web>  \n      <compilation debug=\"true\" targetFramework=\"4.0\" />  \n      <caching>  \n        <outputCacheSettings>  \n          <outputCacheProfiles>  \n            <add name=\"CacheFor60Seconds\" duration=\"60\" varyByParam=\"format\" varyByHeader=\"Accept\" />  \n          </outputCacheProfiles>  \n        </outputCacheSettings>  \n      </caching>  \n    </system.web>  \n</configuration>  \n  \n```"
  syntax:
    content: >-
      [System.AttributeUsage(System.AttributeTargets.Method)]

      public sealed class AspNetCacheProfileAttribute : Attribute, System.ServiceModel.Description.IOperationBehavior
